(447, 35262, '狗', '混種犬          ', 'F', 'MEDIUM', '黑黃色', 'ADULT', 'T', 'F', 51, 'https://www.pet.gov.tw/upload/pic/49d37976-9921-4002-abb4-349531c7fada.jpg', '我是拖拖一隻大概八歲的狗狗，我是女生，虎斑妹穿虎斑襪，偶爾會爆衝與人互動算是良好  我是一隻由其他動物之家轉入的犬隻，已經在收容所待七到八年了，我的個性算是活潑衝動的，希望可以回家', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
(448, 35263, '狗', '混種犬          ', 'F', 'MEDIUM', '虎斑色', 'ADULT', 'T', 'F', 51, 'https://www.pet.gov.tw/upload/pic/d1cf6bd2-e494-45ec-bcf8-63b92b06bc0c.jpg', '我是從淡水動物之家來到新店的，到新店已經7年了，我比較膽小怕生，不主動親人，但是跟室友相處還算和諧', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
(449, 35267, '狗', '混種犬          ', 'M', 'MEDIUM', '黑色', 'ADULT', 'F', 'F', 51, 'https://www.pet.gov.tw/upload/pic/cebc4bca-240b-499c-9255-941ced4ecff7.jpg', '呼名:布里歐..我在107年進到收容所..還沒機會被認養出去..我跟其他狗狗相處融洽.也親人..我無法套繩出籠.只能在籠內活動.也許我習慣了 籠內生活吧 .我可以摸.會坐下..安安靜靜的 ', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
(450, 35273, '狗', '混種犬          ', 'M', 'MEDIUM', '黑黃色', 'ADULT', 'T', 'F', 51, 'https://www.pet.gov.tw/upload/pic/1734496246342.png', '我是小時候就到收容所的小狗狗，我已經在這裡７個年頭了，黑寶 偶爾出籠會太興奮，會想衝出來，出來之後互動良好', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
(451, 35277, '狗', '混種犬          ', 'M', 'MEDIUM', '黑色', 'ADULT', 'T', 'F', 51, 'https://www.pet.gov.tw/upload/pic/8a923295-b08e-4f88-80f9-c3b3ac9af208.JPG', '呼名:藍寶.我於106年在石碇碇平路被通報入所.在收容所已經待了 7年了 ..我跟我的 室友相處融洽.但對人會緊張..閃躲.較敏感.', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
(452, 35284, '狗', '混種犬          ', 'F', 'MEDIUM', '黑色', 'ADULT', 'T', 'F', 51, 'https://www.pet.gov.tw/upload/pic/1734507715868.png', '我叫歐麥，我來到新店動物之家，已經8個年頭了，不知道為什麼都沒遇到我的有緣人，我應該已經有10+以上了，半個狗生都已經在收容所渡過了，親人是我的好優點，有時候會閃避害怕', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
(453, 35288, '狗', '混種犬          ', 'M', 'MEDIUM', '黑色', 'ADULT', 'T', 'F', 51, 'https://www.pet.gov.tw/upload/pic/708c7fbf-4cd3-42c5-9f53-75c039abfa76.jpg', '我是阿源一個大男生，有時候會畏縮緊張敏感，但是跟室友一起出來是非常ok，105年就到了收容所剛來的時候還是一隻小baby我等於是在收容所度過了半個狗生，我不知道我後面的日子是否還是一直待在收容所，我的狗生是不是就在收容所完成了……', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
(454, 35293, '狗', '混種犬          ', 'F', 'MEDIUM', '黑色', 'ADULT', 'T', 'F', 51, 'https://www.pet.gov.tw/upload/pic/1734491620112.png', '107年從淡水動物之家來到新店，個性穩定，不會主動親人親狗不護食', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
(455, 35300, '狗', '混種犬          ', 'F', 'MEDIUM', '棕色', 'ADULT', 'T', 'F', 51, 'https://www.pet.gov.tw/upload/pic/fe032455-e0ac-4365-b4c4-77452cf911b8.jpg', '我是106年入所的 菜菜子.是女生.體型算中型我在收容所待嘞也6年嘞.還在繼續等家.我牽繩隨行良好.與人互動較敏感.溫和.害怕..與狗互動也很融洽.大家可以來新店動物之家與我互動.', '2025-05-18 09:24:04', '2025-05-18 09:24:04');
INSERT INTO `shelter_dogs_info` (`id`, `animal_id`, `animal_kind`, `animal_Variety`, `animal_sex`, `animal_bodytype`, `animal_colour`, `animal_age`, `animal_sterilization`, `animal_bacterin`, `shelter_id`, `picture`, `animal_remark`, `created_at`, `updated_at`) VALUES
(456, 35309, '狗', '混種犬          ', 'M', 'SMALL', '黑色', 'ADULT', 'T', 'F', 51, 'https://www.pet.gov.tw/upload/pic/1734496330045.png', '七七是20180105入所.114115就要入所滿七年了!狗如其名~狗生地一個七，在收容所等很久了!身為黑狗成犬.普通平凡.真的不太會有機會被看到.年紀沉穩成熟.不拆家.能陪你作伴成長的好夥伴!', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
(457, 35313, '狗', '混種犬          ', 'F', 'MEDIUM', '黑色', 'ADULT', 'T', 'F', 51, 'https://www.pet.gov.tw/upload/pic/494cf1c9-09ee-42c6-95b9-27f41561d6e7.jpg', '我是小敏一個女生年齡約五到六歲個性緊張膽小容易害怕閃躲，無法與人互動，107年入所幼犬，我在汐止被民眾通報的幼犬，因為個性緊張，所以很難與人互動，無法得到認養的機會', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
(458, 35314, '狗', '混種犬          ', 'F', 'MEDIUM', '黑色', 'ADULT', 'T', 'F', 51, 'https://www.pet.gov.tw/upload/pic/190ede1a-2fb0-4ff4-a531-a621bef0bcc4.jpg', '我是暢暢女生一開始個性有點緊張，害怕經由志工多年的牽引，現在已經算是可以帶出籠的犬隻，而且比較不會緊張 我是107年入所的犬隻剛入所的時候是幼犬，因為個性太容易緊張了，所以沒有被人領養，已經在收容所呆了六七年了，不知道有沒有機會可以回家？', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
(459, 35319, '狗', '混種犬          ', 'F', 'MEDIUM', '黑色', 'ADULT', 'T', 'F', 51, 'https://www.pet.gov.tw/upload/pic/1734496004907.png', '呼呼 親人 ，可以摸，梳毛OK，疑似聲帶被割除，我是幼犬時就進收容所。在收容所已經7-8年頭，一直都沒有認養出去', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
(460, 35325, '狗', '混種犬          ', 'F', 'MEDIUM', '黑色', 'ADULT', 'T', 'F', 51, 'https://www.pet.gov.tw/upload/pic/315858d3-a25e-4ede-9dad-f0c0ddc57018.jpg', '我是點點女生，我是一隻主動而且親人的狗狗，但是偶爾會有點敏感對是有非常友善，而且不護食  我是107年入所的幼犬，當時是因為民眾陳情的案子進而到收容所，我已經在收容所待了5年了，不知道有沒有機會可以回到自己的家？', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
(461, 35327, '狗', '混種犬          ', 'F', 'BIG', '黑色', 'ADULT', 'T', 'F', 51, 'https://www.pet.gov.tw/upload/pic/1703224169445.png', '大家好，我是皮皮我是一一隻很親人的狗，但是不親室友，我已經換過了很多室友現在終於換到一個跟我很和平的室友 是107年被不擬飼養進來的皮皮我其實是一隻很聽話的狗狗，但是我不知道為什麼飼主會把我退養，我到了收容所之後就變得個性不好，容易跟室友起衝突', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
(462, 35332, '狗', '混種犬          ', 'M', 'SMALL', '黑色', 'ADULT', 'T', 'F', 51, 'https://www.pet.gov.tw/upload/pic/1703228696706.png', '我叫小飛志工非常喜歡我，我非常平易近人主動與人親近，我到107年到收容所的之前也曾經被認養，但是不知道是什麼原因而被事主退養了我到收容所又經過了五六個年頭，我現在個性很平易近人又活潑，但是我的狗生還在收容所裡面待著不知道還要等多久才能被認養', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
