(477, 35536, '狗', '混種犬          ', 'F', 'MEDIUM', '灰黑色', 'ADULT', 'T', 'F', 53, 'https://www.pet.gov.tw/upload/pic/1700544373485.png', '親人~活潑 ~好動~警覺性高 隨行良好~與人互動溫和親切~牠叫皮皮~很適合顧家~都不怕有小偷來闖空門', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
