(480, 35555, '狗', '混種犬          ', 'M', 'MEDIUM', '黑黃色', 'ADULT', 'T', 'F', 53, 'https://www.pet.gov.tw/upload/pic/1735901216191.png', '親人~活潑 ~  隨行良好~與人互動溫和親切~ 大家好~我叫淘淘~希望能找到有緣的人帶我回家', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
