(482, 35558, '狗', '混種犬          ', 'M', 'MEDIUM', '黃色', 'ADULT', 'T', 'F', 53, 'https://www.pet.gov.tw/upload/pic/1735901126901.png', '緊張~害羞~慢熱  隨行畏縮~與人互動害羞~與狗無互動 牠叫威力~是一隻很壯的大黃狗~~比較慢熱~如果你跟牠熟了~牠就會跟你玩了', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
(483, 35559, '狗', '混種犬          ', 'F', 'MEDIUM', '黑色', 'ADULT', 'T', 'F', 53, 'https://www.pet.gov.tw/upload/pic/1736564191806.png', '親人~活潑~好動  隨行良好~與人互動主動親切~與狗互動融洽 我叫莉莉~我是一隻親人活潑愛玩的狗狗~很愛出去玩~有沒有喜歡我的人啊?  ', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
(484, 35561, '狗', '混種犬          ', 'F', 'MEDIUM', '黑色', 'ADULT', 'T', 'F', 53, 'https://www.pet.gov.tw/upload/pic/1735901433013.png', '親人~溫和~隨行良好~與人互動溫和~與狗互動融洽 大家好~我叫滾滾~希望能找到有緣的人帶我回家', '2025-05-18 09:24:04', '2025-05-18 09:24:04'),
